import React, { Component } from 'react';
import './PhotoBlock.css';

class PhotoBlock extends Component {
    render(){
        let block;
        if(this.props.left){
            block = (
                <div >
                    <img className = "block" src={this.props.url} />
                    <div className = "block">{this.props.title}</div>
                </div>
            )
        }
        else{
            block = (
                <div >
                    <div className = "block">{this.props.title}</div>
                    <img className = "block" src={this.props.url} />
                </div>
            )
        }
        return(
            <div>
                {block}
            </div>
        );
    }
}

export default PhotoBlock;
